import React from 'react'

const Footer = () => {
    return (
        <div className='bg-gray-700 p-4'>
            <div className='conatiner mx-auto text-center font-bold text-white'>
            Projeto desenvolvido por: Danillo Carvalho / <a href='https://www.linkedin.com/in/danillo-c%C3%A9sar-33133914/'>Linkedin</a> / <a href='https://github.com/dancesar'>Github</a>
            </div>
        </div>
    )
}

export default Footer
